import React from "react";
import SvgIcon from '@mui/material/SvgIcon';
import HotPeppericon from '../../images/hotpepper.png';
import HotPeppericonChecked from '../../images/googlemap.png';


export function HotPepperIcon(props) {
  return (
    <SvgIcon
      component="span">

      {props.checked ? 

        <img src={HotPeppericonChecked} width="50" height="50"></img> 
        :
        <img src={HotPeppericon} width="50" height="50"></img>
      }

    </SvgIcon>
  );
};
